Want to do genetic engineering in your home? I started @theodininc 7 years ago with this crazy idea. I had no experience running a business. I decided to build the company without investors in order to be able to push boundaries no one else has or is doing. I've almost given up so many times. Luckily, I have always had an amazing team. I learned, if you are passionate enough about something, no matter how crazy, even if no one believes in you, you can drag the world kicking and screaming to that future you see. 

I appreciate all the support everyone has given us over the years. 🙏🏼❤️

