Not Long For This World

The idea for this art show was a kind of vision so to speak. I wouldn't say I wrote a story as much as the story came to me. The story was set in 1963 after DNA discovery won the Nobel Prize in 1962. There was an apocalyptic event and I was one of the survivors, the other, my lover. We were living alone together in a safe house surviving the apocalypse when she passed away. In deep pain and mourning I started to build devices using her organs that contributed to my survival, helped me keep going while living trapped alone in this space. Her heart beats powered a lamp. Her lungs created an air filtration gas mask. Her eye a camera to see the world through her view. Her brain allowed me to relive her memories. Her liver could be fermented for alcohol. Her ovaries and uterus to try and create offspring. Her bones for a chalice lined with gene therapies to end it all. And more. 

I tried to create this world inside the gallery @tyrellgallery as true to what I saw in my mind as possible. It was meant to be immersive. There were no descriptions of works or artist statements. You walked in through plastic liner into this world that was created. And then I gave a 10 minute performance living out that reality and narrating it live for people to experience.

This show took an immense amount of effort. Electronics, programming, chemistry, organ preservation, many things that I painstakingly crafted all by myself over months. I'm really proud that everything in the show had my sweat and blood on it. All for one single night. I like the ephemeral nature of that. You had to be there.

Over the next few weeks I will post more about the individual pieces I created. But for now I'm going to say that if you weren't there you really missed out. 

Thanks to all the people who supported me, put up with me or helped me while I was working on this

